import React from "react";
import Header from "../components/Header/Header";

const index = () => {
  return (
    <div>
      <Header />
      <style global jsx>{`
        @import url("https://fonts.googleapis.com/css?family=Sen:400,700&display=swap&subset=latin-ext");

        :root {
          --main-color: #ef4476;
        }

        * {
          margin: 0;
          padding: 0;
          box-sizing: border-box;
          font-family: "Sen", sans-serif;
        }
      `}</style>
    </div>
  );
};

export default index;
